    value: "Cash on hand updated.  1. Excessive contributions were memo records.  These
      donations were reallocated by Obama Victory Fund. We have now received the reallocation
      information and have amended our reports to reflect that reallocation.    2.
      The donors with foreign addresses were vetted by Obama Victory Fund and none
      of our donors were foreign nationals. This is the clarifying information they
      provided to the FEC:  You requested additional information regarding contributions
      to the Committee from individuals with mailing addresses outside of the United
      States of America. The Committee has established a complex and thorough vetting
      system which meets and surpasses the procedural requirements of the Federal
      Election Campaign Act (the Act ) and Commission regulations to ensure that the
      Committee does not knowingly accept, and has not knowingly accepted here, any
      contributions from foreign nationals or from other prohibited sources.   In
      designing and implementing its contribution vetting system, the Committee has
      given special care to the process of accepting contributions from donors who
      may live abroad to ensure that contributions are not knowingly received from
      foreign nationals. Donors who contribute online are required to check a box
      confirming that they are either a United States citizen or a lawfully admitted
      permanent resident of the United States. Donors who enter a foreign address
      are further required to enter a valid U.S. passport number before making a contribution.
      The Committee then follows up with such donors to request a copy of their U.S.
      passports and engages in a careful screening process to vet and examine each
      donor to ensure they are not a foreign national and to confirm the validity
      of each contribution. Individuals who make contributions to the Committee in
      person at events held outside the United States are separately required to provide
      a copy of a valid U.S.passport and submit a contribution form confirming they
      are not a foreign national. Any contribution found to be from a foreign national
      or any other prohibited source is promptly refunded. Given this process, the
      Committee has information for all of the contributors identified in your request
      for additional information confirming, to the best of the Committee's knowledge,
      that none of them are foreign nationals or their contributions have been refunded.
      \   3. Printing-Handbill and Printing-Handbill-NO Candidate were for Generic
      Campaign Activity. GOTV Frisbees and GOTV Buttons & Stickers were also for Generic
      Campaign Activity. Entries amended to reflect this description. All of the other
      Schedule B payments met the definition of exempt activity as you described and
      none of the transfers we received were to specifically fund these activities.
      \   4. The disbursements for Printing-GOTV-Exempt-No Cand was misreported as
      exempt. They should have been reported as generic campaign activity and the
      entries have been corrected.     5. The description of Vouter Registration Materials
      has been amended to GOTV Buttons Stickers & Posters. These were Generic Campaign
      Activity..    6. Friends of Sherrod Brown advance receipt received and reported
      on May 16, 2012 = $15,000. They advanced an additional $20,000 which was received
      and reported on October 10, 2012.     Betty Sutton for Congress advance receipt
      received and reported on July 31, 2012 = $2,567.39. They  also advanced $5,134.78
      on September 14, 2012 and $2,567.39 on October 4, 2012.    7. The Schedule H6
      match was for a debt payment to Winning Connections incurred during the 2009-2010
      election cycle.    8. This was a debt payment to Winning Connections for GOTV
      robo calls which did not refer to federal candidates nor promote, support, attack,
      or oppose any candidate for Federal office.    9. None of these transfers were
      used for activities prohibited by 11 CFR 300.34. We maintain separate accounts
      and track expenses to ensure we are in compliance.  \n"
